The goal of the impact is to enable users to write async fn in traits and impls in a natural way. As a simple example, we would like to support the ability to write an async fn in any trait: trait Connection { async fn open(&mut self); async fn send(&mut self); async fn close(&mut self);
} Along with the corresponding impl: impl Connection for MyConnection { async fn open(&mut self) { ... } async fn send(&mut self) { ... } async fn close(&mut self) { ... }
} The goal in general is that async fn can be used in traits as widely as possible: for foundational traits, like reading, writing, and iteration; for async closures; for async drop, which is built in to the language; in dyn values, which introduce some particular complications; in libraries, for all the usual reasons one uses traits; in ordinary programs, using all manner of executors.

23.body:
Support async fn syntax in traits. The core idea is that it desugars into impl trait in traits : trait SomeTrait { async fn foo(&mut self);
} // becomes: trait SomeTrait { fn foo<(&mut self) -> impl Future<Output = ()> + '_;
} Naturally it should also work in an impl: impl SomeTrait for someType { async fn foo(&mut self);
} For async functions in traits to be useful, it is important that traits containing async fn be dyn-safe, which introduces a number of challenges that we have to overcome.

