Support -> impl Trait (existential impl trait) in traits. Core idea is to desugar such thing into a (possibly generic) associated type: trait SomeTrait { fn foo<(&mut self) -> impl Future<Output = ()> + '_;
} // becomes something like:
//
// Editor's note: The name of the associated type is under debate;
// it may or may not be something user can name, though they should
// have *some* syntax for referring to it. trait SomeTrait { type Foo<'me>: Future<Output = ()> + 'me where Self: 'me; async fn foo(&mut self) -> Self::Foo<'_>;
} We also need to support -> impl Trait in impls, in which case the body desugars to a "type alias impl trait": impl SomeTrait for SomeType { fn foo<(&mut self) -> impl Future<Output = ()> + '_ { }
} // becomes something using "type alias impl Trait", like this: trait SomeTrait { type Foo<'me> = impl Future<Output = ()> + 'me where Self: 'me; fn foo(&mut self) -> Self::Foo<'_> { ... }
}

