In the case of async Rust, given a trait Foo that contains async fn methods, we wish to be able to have the user write dyn Foo without having to specify the values of the associated types that contain the future types for those methods. Consider the fully desugard example: trait Foo { type Method<..>: Future; fn method() -> Self::Method<..>
} Roughly speaking we wish to be able to supply an impl like impl Foo for dyn Foo { type Method<..> = Box<dyn Future<..>>; fn method() -> Self::Method { // call, via vtable, a shim that will create the `Box` // (or whichever smart pointer is desired) }
} Ideally, this would be a general capability that users can use to control the adaptation of "known types" to dyn types for other traits.

